            IPassthroughGetter item,
            bool doMasks,
            out Passthrough_ErrorMask errorMask,
            Passthrough_TranslationMask translationMask,
            string name = null)
        {
            ErrorMaskBuilder errorMaskBuilder = doMasks ? new ErrorMaskBuilder() : null;
            Write_Xml(
                name: name,
